import styled from "styled-components";

const Container =  styled.div`
display:flex;
flex-direction:row;
margin-bottom: 20px;
`;

const Check = styled.button`
border-radius: 50%;
border: 3px solid blue;
width: 20px;
hegith: 20px;
margin-right: 10px;

`;
function TodoItems() {
    return (
        <Container>
            <Check></Check>
        </Container>
    )
}

export default TodoItems;
